import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import { DollarSign, AlertTriangle, Package, Users } from 'lucide-react';
import { StatCard, Card } from '../../components/ui/ComponentesUI';

const DashboardAdmin = ({ dashboardData }) => {
    // Extraemos los datos del prop. El backend ya nos da todo calculado.
    const { kpis, charts, low_stock_products } = dashboardData;

    return (
        <div className="space-y-6">
            <h1 className="text-3xl font-bold text-gray-800">Dashboard</h1>
            
            {/* Sección de Indicadores Principales (KPIs) */}
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
                <StatCard 
                    title="Ventas del Día" 
                    value={`$${(kpis.ventas_del_dia || 0).toFixed(2)}`} 
                    icon={DollarSign} 
                    color="bg-green-500" 
                />
                <StatCard 
                    title="Ganancia Bruta del Día" 
                    value={`$${(kpis.ganancia_bruta_del_dia || 0).toFixed(2)}`}
                    icon={DollarSign} 
                    color="bg-sky-500" 
                />
                <StatCard 
                    title="Ticket Promedio" 
                    value={`$${(kpis.ticket_promedio || 0).toFixed(2)}`} 
                    icon={Users} 
                    color="bg-blue-500" 
                />
                <StatCard 
                    title="Productos Vendidos Hoy" 
                    value={kpis.productos_vendidos || 0} 
                    icon={Package} 
                    color="bg-purple-500" 
                />
            </div>
            
            <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
                {/* Columna principal con el gráfico de ventas */}
                <div className="lg:col-span-2">
                    <Card>
                        <h2 className="text-xl font-bold text-gray-800 mb-4">Ventas de los Últimos 30 Días</h2>
                        <ResponsiveContainer width="100%" height={300}>
                            <BarChart data={charts.ventas_diarias}>
                                <CartesianGrid strokeDasharray="3 3" />
                                <XAxis dataKey="name" />
                                <YAxis tickFormatter={(value) => `$${value}`} />
                                <Tooltip formatter={(value) => `$${value.toFixed(2)}`} />
                                <Legend />
                                <Bar dataKey="Ventas" fill="#4f46e5" />
                            </BarChart>
                        </ResponsiveContainer>
                    </Card>
                </div>

                {/* --- INICIO DE NUEVO COMPONENTE --- */}
                {/* Columna lateral con la alerta de bajo stock */}
                <div>
                    <Card>
                        <div className="flex items-center gap-3 mb-4">
                            <AlertTriangle className="text-yellow-500" size={24} />
                            <h2 className="text-xl font-bold text-gray-800">Productos con Bajo Stock</h2>
                        </div>
                        {low_stock_products && low_stock_products.length > 0 ? (
                            <ul className="space-y-3">
                                {low_stock_products.map(product => (
                                    <li key={product.id} className="flex justify-between items-center text-sm">
                                        <span className="text-gray-700">{product.name}</span>
                                        <span className="font-bold text-red-600 bg-red-100 px-2 py-1 rounded-full">
                                            {product.stock} unid.
                                        </span>
                                    </li>
                                ))}
                            </ul>
                        ) : (
                            <p className="text-sm text-gray-500">No hay productos con bajo stock. ¡Buen trabajo!</p>
                        )}
                    </Card>
                </div>
                {/* --- FIN DE NUEVO COMPONENTE --- */}
            </div>
        </div>
    );
};

export default DashboardAdmin;
